INSERT INTO `big_property` VALUES (8,'HTML просто язык разметки, там особо не развернешься, чтобы долго изучать. Пункта с CSS нет, вот там есть свои весёлости. Работа с tomcat сводилась к поднятию сервера, на котором крутится небольшой проект для отображения данных и работы с БД. В идеале бы прицепить сюда хибернейт, с которым я пока не дружу, и спринг.');
INSERT INTO `big_property` VALUES (9,'<%@ page contentType=\"text/html\" pageEncoding=\"UTF-8\"%>\r\n<%@ taglib prefix=\"c\" uri=\"http://java.sun.com/jsp/jstl/core\" %>\r\n<%--\r\n  Created by IntelliJ IDEA.\r\n  User: miha\r\n  Date: 28.01.13\r\n  Time: 11:48\r\n  To change this template use File | Settings | File Templates.\r\n--%>\r\n<div id=\"wrapper\">\r\n    <div class=\"container\">\r\n        <div id=\"centerpanel\">\r\n            <div id=\"leftbar\">\r\n                <!--#begin container1 #-->\r\n                <c:set var=\"nameContainer\" scope=\"request\" value=\"${\'container1\'}\"/>\r\n                <jsp:include page=\"../../manager/dynamicpage/containerSel.jsp\"/>\r\n                <!--# container1 end#-->\r\n            </div>\r\n            <%--Центральная страница--%>\r\n            <div  id=\"content\">\r\n                <%--Ошибки системы--%>\r\n                <jsp:include page=\"../../template/error.jsp\"/>\r\n                <!--#begin centerPage #-->\r\n                <jsp:include page=\"../../manager/dynamicpage/centerPage.jsp\"/>\r\n                <!--# centerPage end#-->\r\n                <!--#begin container2 #-->\r\n                <c:set var=\"nameContainer\" scope=\"request\" value=\"${\'container2\'}\"/>\r\n                <jsp:include page=\"../../manager/dynamicpage/containerSel.jsp\"/>\r\n                <!--# container2 end#-->\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>');
INSERT INTO `big_property` VALUES (11,'Вряд ли найдётся Java разработчик, который не знает что такое Spring Framework. Одними из базовых технологий данного фреймворка являются IoC контейнер и поддержка AOP. Эти технологии позволяют успешно разбивать архитектуру приложения на обособленные слои, как на уровне классов, так и на уровне компоновки объектов во время выполнения. Казалось бы, что приложение отлично структурировано на элементы/слои, но по своей сути оно остаётся монолитным. Монолитным во время выполнения (runtime)! Только в рамках данного фреймворка не существует универсальных решений этой проблемы. Чуть меньшее количество Java разработчиков слышало об OSGi. Это спецификация модульных систем для Java платформы. Использование конкретной реализации данной спецификации в качестве основы приложения позволяет сделать его модульным, как во время выполнения, так и на физическом уровне (уровне файлов). О синергии этих технологий и пойдёт речь в этой статье.');
